                        <label className="items-available-text text-center-i m-t-b-5">{currentWl} Mint</label>
                      </div>
                      <div className="Items-available-div">
                        <label className="items-available-text text-right-i">{currentWl == 'GOG + OG' && <span>WL - Mint Starts in</span>}{currentWl == 'WL' && <span>PUBLIC - Mint Starts in</span>}{currentWl == '' && <span>GOG + OG - Mint Starts in</span>}{currentWl == 'PUBLIC' && <span>PUBLIC MINT</span>}</label>
                        <label className="items-available-text text-right-i">{currentWl != 'PUBLIC' && <span className="fs-36-i">{time}</span>}{currentWl == 'PUBLIC' && <span>---</span>}</label>
                      </div>
                    </div>
                    {/* {!isMobile && 
                    <div className="remaining-time-div">
                      <label className="remaining-time">00:00:00</label>
                    </div>
                    } */}
                    {!isMobile && 
                    <div className='battery'>
                    {
                      setBars.map(function(item,i) {
                        if (completed >= item) {
                          return <div className="bar active" data-power={item}></div>;
                        }
                        else {
                          return <div className="bar" data-power={item}></div>;
                        }
                      })
                    }
                    {currentWl == 'GOG' &&
                    <label className="completed-counts">{1749 - magicHat?.state.itemsRedeemed!} / 1749</label>
                    }
                    {currentWl == 'WL' &&
                    <label className="completed-counts">{6749 - magicHat?.state.itemsRedeemed!} / 6749</label>
                    }
                    {currentWl == 'PUBLIC' &&
                    <label className="completed-counts">{6969 - magicHat?.state.itemsRedeemed!} / 6969</label>
                    }
                  </div>
                    }
                    {isMobile && 
                    <div className="remaining-time-div">
                      <div className="circle-info-mint">00:00:00</div>
                      <div className="circle-info-mint">GOG</div>
                      <div className="circle-info-mint">6666</div>
                    </div>
                    }
                    {/* <div className="mint-progress">
                      <ProgressBar bgcolor={"#6a1b9a"} completed={completed} />
                    </div> */}
                    <div className="remaining-time-div m-t-15 m-b-15">
                      <div className="mint-count">
                        <button
                          className="decrease-count"
                          onClick={decreaseMintCount}
                        >
                          -
                        </button>
                        <label>{mintCount}</label>
                        <button
                          className="increase-count"
                          onClick={increaseMintCount}
                        >
                          +
                        </button>
                      </div>
                    </div>
                    <div className="remaining-time-div m-t-15 m-b-15">
                      {!wallet.connected ? (
                        <div className="Top-connected red">
                          <WalletDialogButton className="Inside-Connect-btn">
                            Connect
                          </WalletDialogButton>
                        </div>
                      ) : (
                        <div
                          className={
                            isUserMinting
                              ? "Top-connected green disabled-btn"
                              : "Top-connected green"
                          }
                        >
                          <button
                            className={
                              shouldMint
                                ? "Inside-Mint-btn w-200"
                                : "Mint-btn-disabled w-200"
                            }
                            onClick={whiteListCheckMint}
                          >
                            {isUserMinting ? "Minting" : "Mint Now"}
                          </button>
                        </div>
                      )}
                    </div>
                  </div>
                </div>
              </div>
            </OutsideClickHandler>
          </div>
        )}
        {!logoLoading && logoAlphaLoading && (
          <div className="logo-loader-parent-alpha">
            <img alt="Alpha-logo" src={LogoWhite} className="pulse-animation" />
          </div>
        )}
      </div>
      <Snackbar
        className="snack-bar"
        open={alertState.open}
        autoHideDuration={6000}
        onClose={() => setAlertState({ ...alertState, open: false })}
      >
        <Alert
          className="bold"
          onClose={() => setAlertState({ ...alertState, open: false })}
          severity={alertState.severity}
        >
          {alertState.message}
        </Alert>
      </Snackbar>
    </div>
  );
};

export default Home;
